import React, { useEffect, useState } from "react";

const Customers = () => {
  const [customers, setCustomers] = useState([]);
  const [loading, setLoading] = useState(true);

  // Fetch customers data from the API
  useEffect(() => {
    fetch("https://localhost:7053/api/Customers")
      .then((response) => response.json())
      .then((data) => {
        setCustomers(data); // Set customers data
        setLoading(false); // Stop loading
      })
      .catch((error) => {
        console.error("There was an error fetching the customer data!", error);
        setLoading(false); // Stop loading on error
      });
  }, []);

  if (loading) return <div>Loading...</div>;

  return (
    <div>
      <h1>Customer List</h1>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Place</th>
            <th>Phone Number</th>
            <th>Email ID</th>
            <th>Base Amount</th>
          </tr>
        </thead>
        <tbody>
           {/* Map through customers and render a row for each */}
           {customers.map((customer) => (
            // Each row should have a unique key prop
            <tr key={customer.ID}>
              <td>{customer.ID}</td>
              <td>{customer.Name}</td>
              <td>{customer.Place}</td>
              <td>{customer.PhoneNumber}</td>
              <td>{customer.EmailID}</td>
              <td>{customer.BaseAmount}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Customers;
